import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class ItemsService {

  constructor() { }

  getAll():String[]{
    return[
      '/assets/images/black-hoodie.jpg',
      '/assets/images/black-sweatshirt.jpg',
      '/assets/images/blue-shirt.jpeg',
      '/assets/images/jeans.jpg',
    ]
  }
}
